import React from "react";
import { Container, Row, Col } from "react-bootstrap";

import Heading from "../Components/Heading";

import Logo from "../Assests/Images/logo/logo.png";

function Resume() {
  return (
    <div className="resume mb-5" id="resume">
      <Container>
        <Row className="justify-content-center  text-center">
          <Col sm={12} md={10} lg={8}>
            <img src={Logo} class="img-fluid w-25" />
          </Col>
        </Row>

        <Row className="border-bottom border-dark">
        <Col>
        <Heading content="NAME HERE" design="p-0 mx-0 mb-2 fs-6 fw-bold text-lg-start text-md-start text-center" />
        </Col>
        <p class="p-0 mt-0 mb-3 fs-7">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor 
                  incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis 
                  nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. 
                  Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore 
                  eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt 
                  in culpa qui officia deserunt.
                </p>

        </Row>
      </Container>
    </div>
  );
}

export default Resume;
